export const factorial = (n) => {
    return n >= 1 ? n * this.factorial(n - 1) : 1;
}

export const choose = (a,b) => {
    let result = (this.factorial(a))/(this.factorial(b) * this.factorial(a-b));
    console.log(a + " , " + b + " = " + result);
    return result;
}
